-- Structure
create table digimon (id int not null auto_increment primary key, name varchar(50) not null, number int not null, typeid int, attributeid int, slots int, memory int, minstatsid int, maxstatsid int);
create table attribute (id int not null auto_increment primary key, name varchar(8) not null);
create table type (id int not null auto_increment primary key, name varchar(8) not null);
create table stats (id int not null auto_increment primary key, hp int, sp int, atk int, def int, intx int, spd int, abi int, cam int);
create table digivolution (id int not null auto_increment primary key, lowerid int not null, lowertwoid int, upperid int not null, level int, reqstatsid int, casex varchar(100), item varchar(100));
create table skill (id int not null auto_increment primary key, name varchar(100) not null);
create table learnskill (id int not null auto_increment primary key, digimonid int, skillid int, level int);
create table pathcache (srcid int not null, destid int not null, desttype int not null, listpos int not null, edgedestid int not null, lutionid int null, learnid int null);

